Here’s a simple and correct version of a palindrome checking function in JavaScript:

```javascript
function isPalindrome(str) {
    // Remove non-alphanumeric characters and convert to lower case
    const cleaned = str.replace(/[^a-zA-Z0-9]/g, '').toLowerCase();

    // Compare the string with its reverse
    return cleaned === cleaned.split('').reverse().join('');
}

// Example usage
console.log(isPalindrome("A man, a plan, a canal, Panama")); // true
console.log(isPalindrome("Hello, world!")); // false
```

### Explanation

1. **Cleaning the Input**: The function first removes any characters that are not alphanumeric (letters or numbers) using a regular expression (`/[^a-zA-Z0-9]/g`). This is important because spaces, punctuation, and other symbols should not affect the palindrome check. It also converts all characters to lower case to ensure the check is case-insensitive.

2. **Reversing the String**: The cleaned string is split into an array of characters, reversed, and then joined back into a string.

3. **Comparison**: The function checks if the cleaned string is the same as its reversed version. If they are the same, the function returns `true`, indicating the string is a palindrome; otherwise, it returns `false`.

Feel free to adapt this function based on your specific needs or constraints! If you have any more specific requirements or need further assistance, let me know!

